enumeration.description:
Esta propriedade é preenchida pela plataforma, para identificar os contatos que solicitaram a compra do LogManager, sendo primeira ou upsell;
Qualquer mudança nessa propriedade acarretará em problemas na abertura e direcionamento de negócios, e também, bugs no preenchimento de valor interno da plataforma;
Comunicar Rafael Anaya e/ou Luan Alencar.
